--
-- Struktur untuk view `v_laporan_summary`
--
DROP TABLE IF EXISTS `v_laporan_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_laporan_summary`  AS SELECT `h`.`kabupaten_kota` AS `kabupaten_kota`, `h`.`nama` AS `nama_hafiz`, count(`l`.`id`) AS `total_laporan`, sum(case when `l`.`status_verifikasi` = 'disetujui' then 1 else 0 end) AS `laporan_disetujui`, sum(case when `l`.`status_verifikasi` = 'pending' then 1 else 0 end) AS `laporan_pending`, max(`l`.`tanggal`) AS `laporan_terakhir` FROM (`hafiz` `h` left join `laporan_harian` `l` on(`h`.`id` = `l`.`hafiz_id`)) GROUP BY `h`.`id`, `h`.`kabupaten_kota`, `h`.`nama` ;

