DROP TABLE IF EXISTS `v_statistik_kabko`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_statistik_kabko`  AS SELECT `hafiz`.`kabupaten_kota` AS `kabupaten_kota`, count(0) AS `total_hafiz`, sum(case when `hafiz`.`status_kelulusan` = 'lulus' then 1 else 0 end) AS `total_lulus`, sum(case when `hafiz`.`status_insentif` = 'aktif' then 1 else 0 end) AS `penerima_insentif_aktif`, sum(case when `hafiz`.`tahun_tes` = year(curdate()) then 1 else 0 end) AS `pendaftar_tahun_ini` FROM `hafiz` GROUP BY `hafiz`.`kabupaten_kota` ;

